import React from 'react';
import OtpInput from 'react-otp-input';
import "/index.css"

export default function OtpInputComp({otp, setOtp}) {

  return (
    <OtpInput
      value={otp}
      onChange={setOtp}
      numInputs={4}
      renderSeparator={<span>-</span>}
      renderInput={(props) => <input {...props} className='transanctioninput'/>}
    />
  );
}
